import React, { useState } from 'react';
import './styles.css';

const VolunteerPoints = ({ event }) => {
    const [volunteerId, setVolunteerId] = useState('');
    const [hours, setHours] = useState('');
    const [points, setPoints] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        // Submit form logic
    };

    return (
        <div className="volunteer-points">
            <h2 className="text-center">Volunteer Points Management</h2>
            <table className="table table-striped table-bordered">
                <thead className="thead-dark">
                    <tr>
                        <th>Date</th>
                        <th>Team</th>
                        <th>Event</th>
                        <th>Activity</th>
                        <th>Volunteer</th>
                        <th>Default Hours</th>
                        <th>Actual Hours</th>
                        <th>Points</th>
                    </tr>
                </thead>
                <tbody>
                    {event.hours.map((record, index) => (
                        <tr key={index}>
                            <td>{record.date}</td>
                            <td>{record.team}</td>
                            <td>{record.event}</td>
                            <td>{record.activity}</td>
                            <td>{record.volunteer}</td>
                            <td>{record.defaultHours}</td>
                            <td>{record.actualHours}</td>
                            <td>{record.points}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
            <form className="volunteer-form" onSubmit={handleSubmit}>
                <div className="form-group">
                    <label>Volunteer ID</label>
                    <input
                        type="text"
                        className="form-control"
                        value={volunteerId}
                        onChange={(e) => setVolunteerId(e.target.value)}
                    />
                </div>
                <div className="form-group">
                    <label>Hours Worked</label>
                    <input
                        type="text"
                        className="form-control"
                        value={hours}
                        onChange={(e) => setHours(e.target.value)}
                    />
                </div>
                <div className="form-group">
                    <label>Points</label>
                    <input
                        type="text"
                        className="form-control"
                        value={points}
                        onChange={(e) => setPoints(e.target.value)}
                    />
                </div>
                <button type="submit" className="btn btn-primary">
                    Submit
                </button>
            </form>
        </div>
    );
};

export default VolunteerPoints;
